$(document).ready(function(){$("#btnSearch").button({icons:{primary:"ui-icon-search"}}).on("click",function(b){var a=$(this).closest("form");$.ajax({url:a.attr("action"),data:a.serializeArray(),type:"GET",cache:false,statusCode:{200:function(c,e,d){window.location.href=c;return true},203:function(c,e,d){$("#layoutError").text(c).show()}}}).fail(function(d,e,c){alert(d.responseText)});return false})});$(document).ready(function(){$("button[data-icon]").each(function(){$(this).button({icons:{primary:$(this).attr("data-icon")}})}).click(function(a){$("#divReceivingDialog").dialog("option","currentForm",$(a.target).closest("form")).dialog("open");return false});$("#divReceivingDialog").dialog({title:"Receive Cartons",autoOpen:false,width:"auto",modal:true,closeOnEscape:false,open:function(a,b){$(".ui-dialog-titlebar-close").hide()},buttons:[{text:"OK",click:function(b,c){var a=$(this).dialog("option","currentForm");$(b.target).button({disabled:true});$("#btnCancel").button({disabled:true});a.submit()}},{text:"Cancel",id:"btnCancel",click:function(a,b){$("#divReceivingDialog").dialog("close")}}]})});